import "./App.css";
import LoginPage from "./pages/index.js";
import React from "react";
// import { useState, useEffect } from "react";
import axios from "axios";

const response = axios.get("/users/632846307869907503dc522a");

const data = response.data;

function App() {
	return (
		<div className="App">
			<LoginPage />
			<pre>{data}</pre>
		</div>
	);
}

export default App;
